import React, { Component } from 'react';
import index from '../Caduser/index';


class home extends Component {
    render() {
        return(
        <div> 
            <button 
                onClick={() => <Link to={index} /> }>
                Novo Cadastro
            </button>
        </div>
        );
    }
}

export default home;
